<!doctype html>
<html lang="fr">
<head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width,initial-scale=1" />
    <title><?= esc($title) ?></title>

    <style>
        .quiz-wrapper{width:100vw;height:100vh;overflow:hidden;background:#000}
        svg{width:100%;height:100%;display:block}
        .zone-interactive:hover {
            cursor: pointer;
            opacity: 0.8;
        }
        .fo-root {
            /* occupe 100 % de la zone foreignObject */
            width: 100%;
            height: 100%;

            /* remplissage visuel */
            display: flex;
            flex-direction: column;
            justify-content: center; /* vertical */
            align-items: stretch;    /* horizontal */

            padding: 3%;
            box-sizing: border-box;

            /* fond semi-transparent clair */
            background: rgba(255, 255, 255, 0.38);
            border-radius: 10px;
            overflow: hidden;
            font-family: "Segoe UI", sans-serif;
        }

        /* Question principale */
        .fo-root .question {
            font-weight: 700;
            font-size: 2vw; /* responsive selon la largeur de la zone */
            line-height: 1.3;
            text-align: center;
            margin-bottom: 2vh;
            color: #222;
            flex: 0 1 auto;
        }

        /* Liste des choix */
        .choices {
            list-style: none;
            margin: 0;
            padding: 0;
            flex: 1;
            display: flex;
            flex-direction: column;
            justify-content: space-evenly; /* répartit les choix sur toute la hauteur */
        }

        .choice {
            display: flex;
            align-items: center;
            padding: 1vh 1vw;
            margin: 0.5vh 0;
            border-radius: 10px;
            cursor: pointer;
            transition: 0.3s;
            font-size: 1.5vw; /* taille auto adaptée à la zone */
        }

        .choice:hover {
            background: rgba(234, 208, 102, 0.2);
        }

        .choice.selected {
            background: rgba(234, 223, 102, 0.4);
        }

        /* Lettre A-D */
        .choice .letter {
            background: #ead066;
            color: #fff;
            font-weight: bold;
            width: 40px;
            height: 40px;
            border-radius: 50%;
            display: inline-flex;
            align-items: center;
            justify-content: center;
            margin-right: 15px;
            flex-shrink: 0;
        }
    </style>

</head>
<body>
<div class="quiz-wrapper">

    <svg
            id="a"
            data-name="Calque 1"
            viewBox="0 0 1900 1174"
            version="1.1"
            xmlns:xlink="http://www.w3.org/1999/xlink"
            xmlns="http://www.w3.org/2000/svg"
            xmlns:svg="http://www.w3.org/2000/svg">
        <defs
                id="defs1" />
        <image
                width="1900"
                height="1174" preserveAspectRatio="none"
                xlink:href="data:image/png;base64,"
                id="image1" />
        <rect id="ecran_question" x="486" y="197" width="994" height="505"
              fill="transparent" stroke="none"></rect>

        <!-- foreignObject placé aux coordonnées de ecran_question -->
        <foreignObject x="486" y="197" width="994" height="505">
            <div xmlns="http://www.w3.org/1999/xhtml" class="fo-root">
                <form id="quizForm" action="<?= base_url('quiz/repondre') ?>" method="post">
                    <?= csrf_field() ?>
                    <input type="hidden" name="proposition" id="propositionInput">

                    <div class="question">
                        <?= esc($question['libelle']) ?>
                    </div>

                    <ul class="choices">
                        <?php foreach ($question['propositions'] as $i => $prop):
                            $letter = chr(65 + $i); ?>
                            <li class="choice" data-id="<?= $prop['numero'] ?>">
                                <span class="letter"><?= $letter ?></span>
                                <span class="text"><?= esc($prop['libelle']) ?></span>
                            </li>
                        <?php endforeach; ?>
                    </ul>
                </form>
            </div>
        </foreignObject>

        <!-- zone valider visible dans svg  -->
        <path
                d="m 700.7162,1073.8248 19.11044,-79.1718 541.46256,1.82004 21.8405,78.26176 0.91,26.3907 -581.50346,-0.9101 z"
                id="zone_valider" fill="transparent" class="zone-interactive" stroke-width="2" stroke="yellow"/>
        <!-- Barre progression (contour) -->
        <path
                id="barre_progression"
                d="m 601.37238,833.81635 h 780.00002 c 7.8106,6e-5 10,23.53114 10,40.22265 0,7.27808 -2.1894,23.17771 -10,23.17778 H 601.37238 c -2.24504,0 -4.31272,-0.73242 -5.9781,-1.97234 -3.97753,-2.96134 -4.0219,-12.19732 -4.0219,-17.34086 v -34.08723 c 0,-5.54 4.46,-10 10,-10 z"
                fill="none" stroke="#855e03" stroke-width="4"
                opacity="0.7"
        />

        <!-- Remplissage de la barre -->
        <rect id="progressFill"
              x="601" y="833"
              width="0" height="63"
              fill="url(#progressGradient)" rx="10" ry="10" />

        <!-- Dégradé -->
        <defs>
            <linearGradient id="progressGradient" x1="0%" y1="0%" x2="100%" y2="0%">
                <stop offset="0%" stop-color="#FFD700"/>
                <stop offset="100%" stop-color="#FFA500"/>
            </linearGradient>
        </defs>

    </svg>
</div>
    <script>
        document.addEventListener("DOMContentLoaded", function() {
            const choices = document.querySelectorAll(".choice");
            const input = document.getElementById("propositionInput");
            const form = document.getElementById("quizForm");

            let selected = null;

            choices.forEach(choice => {
                choice.addEventListener("click", function() {
                    // Désélection visuelle
                    choices.forEach(c => c.classList.remove("selected"));
                    this.classList.add("selected");

                    // Stocke l'ID réel dans le champ caché
                    const id = this.getAttribute("data-id");
                    input.value = id;
                    selected = id;
                });
            });

            // Valider via la zone SVG "clavier"
            const zoneValider = document.getElementById("zone_valider");
            if (zoneValider) {
                zoneValider.addEventListener("click", function() {
                    if (input.value) {
                        form.submit();
                    } else {
                        alert("Il faut choisir une réponse avant de valider !");
                    }
                });
            }
            //  progression actuelle-->
        const progression =<?= $progression ?>; // en pourcentage
        const progressRect = document.getElementById("progressFill");

        // largeur maximale
       const maxWidth = 780;

        // la largeur à remplir
        const fillWidth = (progression / 100) * maxWidth;

        // animer la barre
          progressRect.setAttribute("width", fillWidth);
        });
    </script>
</body>
</html>